  03> RAINE, Amanda Leigh
  b 05.05.1966
  Amanda b. at Motueka. Address: 27 Asquith Terrace, Brooklyn, Wellington.
  Amanda was educated at Waimea College, Richmond where she was head girl in 1983. She then won an
  American Field Scholarship in 1984. Now, after travelling the world she is a University student.
  03> HAWKES, Martyn Yerrow m on 08.04.1961 to CAMPBELL, Yvonne Mary
  b 19.05.1938
  b 16.11.1940
  Martyn b. at Otaki and m, at Morrinsville. Yvonne, d/o Francis Henry Campbell and Beatrice Blair.
  Address: "Paparahia" Station, Private Bag, Mokau, Taranaki.
  Martyn was educated at Feilding Agricultural College. For a few years he managed a farm at Gordonton in
  the Waikato then farmed at "Paparahia". This property plus another bought by the Company is now managed
  by his nephew, Mark Raine.
